import React from "react";

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCircleQuestion } from "@fortawesome/free-solid-svg-icons";


function Note(props){
    return (
        <div className="note">
            <h1>{props.title}</h1>
            <p>{props.content}</p>
            <button><FontAwesomeIcon className="CircleQuestion fa-beat"
            icon={faCircleQuestion} /></button>
        </div>
    )
}

export default Note;
